import React from 'react'
import { observer } from "mobx-react-lite";
import { Nav, Navbar, NavDropdown } from 'react-bootstrap'

const Navigation = observer(() => {
    return (
        <header>
            <div>
                <p>Logo</p>
            </div> 
        </header>
    )
})

export default Navigation
